import { Box, Container } from "@chakra-ui/react";
import {FormControl,Input} from '@chakra-ui/react'
import {AiOutlineSearch } from "react-icons/ai";
function App() {
  return (
    <div className="App">
  <Container max={'full'} p="4" fontSize={"18"}>

        <Box rounded="lg" boxShadow="base" p="4" >
             <Box mt="2" gap="2" mb="4">
                 <FormControl>
                 <Input type='email' />
                 </FormControl>
                 <Button leftIcon={<AiOutlineSearch />} colorScheme='teal' variant='outline' maxW={'300px'} minW="150px">Call us</Button>
              </Box>
         </Box>
  </Container>
    </div>
  );
}

export default App;
